declare const SQL_QUERY = "\nINSERT INTO PersonAddress (\n  \"createdAt\", \"updatedAt\", \"deletedAt\", \"ncoa\", \"type\", \"personId\", \"addressId\"\n) VALUES (\n  @createdAt, @updatedAt, @deletedAt, @ncoa, @type, @personId, @addressId\n)\nON CONFLICT (\"personId\", \"addressId\") DO UPDATE SET\n\"createdAt\" = MIN(@createdAt, \"createdAt\"), \"updatedAt\" = MAX(@updatedAt, \"updatedAt\"), \"deletedAt\" = IFNULL(@deletedAt, \"deletedAt\"), \"ncoa\" = IFNULL(@ncoa, \"ncoa\"), \"type\" = IFNULL(@type, \"type\")\n";
export default SQL_QUERY;
